import RafKismi from './RafKismi/RafKismi';
import Logo from './Logo.js';


 class AnaKisim extends Component {
    render() {
        return (
            <lu className='Main'>
              <Logo ></Logo>                   
        <RafKismi></RafKismi>   
            </lu>
        )
    }
}
export default AnaKisim;
